"""# **Q2 What are the different categoreis(genere) of movies and TV shows?**"""

# Prepare data
comedy_count = mydata['listed_in'].str.contains('Comedy', case=False, na=False).sum()
action = mydata['listed_in'].str.contains('Action-Adventure', case=False, na=False).sum()
family = mydata['listed_in'].str.contains('Family', case=False, na=False).sum()
animation = mydata['listed_in'].str.contains('Animation', case=False, na=False).sum()
documentary = mydata['listed_in'].str.contains('Documentary', case=False, na=False).sum()
values = [comedy_count, action, family, animation, documentary]
labels = ["Comedy", "Action", "Family", "Animation", "Documentary"]

# Configure plot
plt.figure(figsize=(8, 8))
plt.bar(labels, values, width=0.8, color=["skyblue", "indigo", "green", "pink", "violet"])
plt.xlabel('Type')
plt.ylabel('Count')
plt.title('Bar chart showing common listed_in categories')
plt.show()

"""# **Q3 What is the rating of the Movies and the TV shows as per their type?**"""

sns.set_style("darkgrid", {"grid.color": ".5", "grid.linestyle": ":"})
sns.set_context('notebook')
colors = ["skyblue", "lightcoral"]
g=sns.catplot(x='rating',kind='count',data=mydata,col='type',height=5,palette=colors)
g.set_xticklabels(rotation=90)
g.set(xlabel='The rating',ylabel='The count of each rating')
g.fig.suptitle('Number of movies and shows per type and rating',y=1.03)
g.set_titles('{col_name}s')
plt.show()

"""# **USED GROUPBY FUNCTION**

# **Q4 What are the number of Movies and Shows Released per year?**
"""

s_m_per_year=mydata.groupby('release_year').size()
s_m_mydata=s_m_per_year.reset_index()
s_m_mydata.columns=['year','frequency']
g=sns.relplot(data=s_m_mydata, x='year',y='frequency',kind='line',color='red',height=9)
g.fig.suptitle('Number of Movies and Shows Released Per Year',y=1.04)
g.set(xlabel='Release Year',ylabel='Number of Movies and Shows')
plt.show()

