"""# **Q7 What are the TV shows based on number of seasons?**"""

# Check if there are any 'TV Show' entries in mydata
if 'TV Show' in mydata['type'].values:
    tv_shows = mydata[mydata['type'] == 'TV Show']
    tv_shows['season_count'] = tv_shows['duration'].str.extract('(\d+)').astype(int)
    season_counts = tv_shows['season_count'].value_counts().sort_index()

    plt.figure(figsize=(5, 3))
    sns.barplot(x=season_counts.index, y=season_counts.values, palette='viridis')
    plt.title('Number of TV Shows by Seasons on Disney+')
    plt.xlabel('Number of Seasons')
    plt.ylabel('Number of TV Shows')
    plt.tight_layout()
    plt.show()

    selected_shows = tv_shows[tv_shows['season_count'].isin([10, 16, 19, 32])][['title', 'country', 'season_count']]
    print(selected_shows)
else:
    print("No 'TV Show' entries found in mydata.")

